import React from 'react';
import './DigitalMenu.css';

const DigitalMenu: React.FC = () => {
  return (
    <div className="digital-menu">
      <header className="menu-header">
        <img src="logo.png" alt="Restaurant Logo" className="menu-logo" />
        <h1 className="menu-title">DishUp</h1>
      </header>

      <main className="menu-section">
        <h2>Our Menu</h2>
        <ul className="menu-list">
          <li>Dish 1 - $10</li>
          <li>Dish 2 - $15</li>
          <li>Dish 3 - $12</li>
        </ul>
      </main>

      <footer className="menu-footer">
        <h3>Gallery</h3>
        <div className="menu-gallery">
        <img src="/pexels-valeriya-1199957 (1).jpg" alt="Dish 1" className="gallery-image" />
        <img src="picture2.jpg" alt="Dish 2" className="gallery-image" />
          <img src="picture3.jpg" alt="Dish 3" className="gallery-image" />
        </div>
      </footer>
    </div>
  );
};

export default DigitalMenu;
